(18, 'Desi Lestari', 'desilesta02@gmail.com', 'Curriculum Vitae', 'Dear Human Resources Development,\r\n\r\nGood Morning, \r\n\r\nHope you are doing well. \r\n\r\nThis is Desi, \r\n\r\nI am writing this email to apply for availability positions for Debindo.\r\n\r\nI have a graduated from Mercu buana University of Public Relations and got Graduation Honor of Cum Laude. I have experienced 7 years in event management. I am working in The biggest Exhibition company is Reed Exhibitions or RX Exhibitions and handled the biggest event are Keramika, Mega Build, Mommy n Baby Expo, Maritime and Franchise License Expo. My was experience as Assistant Manager, Marketing Public Relations, now Project Executive. I have experienced in Indonesian Ceramic Industry Association (ASAKI) and help to support Ministry of Industry of Republic Indonesia for their activities. My work experiences is event management, create proposal for Media partner, Press Release, Create opening ceremony, seminars, or launch product, Associations, Ministries, Hotels, Airlines for support our event, Manage and maintain all social media f'),
(19, 'BAYU ROBIANSYAH', 'bayurobiansyahh@gmail.com', 'Job Opportunity', 'It\'s been 7 years since my career focused on the Exhibition, Conference and Corporate Event, this brings me a lot of experience of how the certain industry should be levelized through the Trade Show and Business Matching either through online or offline. \r\n\r\nAs Event Planner, I\'ve been analyzing the atmosphere of creative industry should showcase through the creative way to engage the audiences, e.g trade show and business conference which are attended by the worldwide players. \r\n\r\nTo sum up, it would be very glad and pleasure to join with you.\r\n\r\nYour Sincerely,\r\nBayu Robiansyah (ROBY)'),
