(21, 'Andina Sunarhalika', 'andinasunar@gmail.com', 'Permohonan Pengajuan Magang', 'Selamat pagi, \r\nPerkenalkan saya Andina Sunarhalika mahasiswa semester 6  Program studi MICE, Politeknik Negeri Jakarta izin bertanya apakah terdapat kontak yang dapat saya hubungi untuk dapat mengajukan permohonan magang?\r\nTerima kasih'),
