(23, 'arigaimpor', 'arigaimpor905@gmail.com', 'PENAWARAN JASA IMPORT & SEWA LEGALITAS UNDERNAME CONSIGNEE', 'Kami dari PT.BINTANG SAMUDERA ASIA atau biasa di kenal BISA CARGO. menawarkan jasa customs clearance dan penyewaan bendera / legalitas undername export-import, SEA & AIR Port.\r\njasa import service :\r\n- Undername Import\r\n- Borongan All-in\r\n- Door to door Service\r\n- Handle barang tertahan di pabean Air Port maupun Sea Port\r\n\r\nMore information\r\nConsul with me\r\nHp / wa 0822 1574 4447'),
(24, 'arigaimpor', 'arigaimpor905@gmail.com', 'PENAWARAN JASA IMPORT & SEWA LEGALITAS UNDERNAME CONSIGNEE', 'Kami dari PT.BINTANG SAMUDERA ASIA atau biasa di kenal BISA CARGO. menawarkan jasa customs clearance dan penyewaan bendera / legalitas undername export-import, SEA & AIR Port.\r\njasa import service :\r\n- Undername Import\r\n- Borongan All-in\r\n- Door to door Service\r\n- Handle barang tertahan di pabean Air Port maupun Sea Port\r\n\r\nMore information\r\nConsul with me\r\nHp / wa 0822 1574 4447'),
(25, 'Caesartika Delfira', 'chacatikadelfira@gmail.com', 'Surat Perkenalan PT. Amarcon Jaya Utama', 'Kepada Yth. \r\nBpk/Ibu PT Debindo\r\nDi Tempat \r\n\r\nKepuasan pelanggan adalah perhatian utama kami\r\n\r\nKami ingin mengambil kesempatan ini untuk memperkenalkan secara singkat perusahaan kami PT. AMARCON JAYA UTAMA, sehingga Anda dapat mempertimbangkan untuk menambahkan perusahaan kami ke daftar penyedia layanan yang disetujui.\r\n\r\nPT. AMARCON JAYA UTAMA adalah perusahaan di bidang Kontraktor Umum di Indonesia.Kami adalah Perusahaan Rekayasa dan Kontraktor yang menawarkan berbagai macam jasa rekayasa, pengadaan, Konstruksi dan pemeliharaan untuk proses pendirian bangunan industri dan komersial.\r\n\r\nLingkup pelayanan kami adalah Mekanikal, Elektrikal, Plumbing, Pemanas, Ventilasi, AC (Agen DAIKIN INDONESIA), mesin relayout.\r\n\r\nBerikut terlampir profil Perusahaan kami untuk ulasan Anda dan Kami berharap Anda dapat memberi kami kesempatan untuk bergabung dengan Perusahaan Anda di masa depan.\r\n\r\n\r\nJangan ragu untuk meminta penawaran untuk proyek Anda yang akan datang, kami berjanji, kami akan memberikan harga yang sangat'),
(26, 'irene', 'irene@floweradvisor.com', 'Penawaran Member Corporate Flower Advisor', 'Dear Bapak/Ibu\r\nBagian Pengadaan Umum\r\nDEBINDO GROUP\r\n\r\nSalam Kenal,\r\nSaya Irene dari FlowerAdvis or, dimana perusahaan kami melayani jasa pe ngiriman untuk \r\nBunga Papan, Parcel, Handbouqet, Bunga Meja, Baby Gift Set, Hampers, Cake dan lainlain.\r\n\r\nSaya ingin mengajukan penawaran untuk menjadi Vendor di Perusahaan Anda.Untuk benefit yang anda dapatkan tertera dibawah.\r\nRegistrasi mudah dan cepat hanya mengisi Form saja serta melampirkan copy NPWP perusahaan.\r\nCatalog kami bisa anda lihat di www.floweradvisor.co.id\r\n\r\nKeuntungan yang akan di peroleh pelanggan Corporate FlowerAdvisor :\r\n\r\nPENDAFTARAN CORPORATE/MEMBERSHIP ADALAH BERSIFAT GRATIS, TIDAK MENGIKAT SERTA TIDAK ADA TUNTUTAN MINIMAL ORDER\r\nAnda akan mendapatkan batas kredit untuk pembelian dengan pembayaran berkala (2-4 minggu setelah order dikirimkan)\r\nSistem One-Stop Vendor (satu vendor yang melayani semua kebutuhan gift anda)\r\n15% disc untuk product bunga dari harga yang tertera di website. *\r\n10% untuk produk cake, parcel, babygift, fruit basket '),
(27, 'Sim Pin Yi', 'pinyi_sim@singaporeair.com.sg', 'Introduction to Singapore Airlines', 'Good Afternoon debindo Team,\r\n\r\nGreetings from Singapore Airlines, my name is Pin Yi and I am from the Bali office of Singapore Airlines. Understand that debindo is one of the biggest conference organisers in Indonesia, and we are looking for opportunities to work together in providing an option for your delegates to fly with Singapore Airlines to attend your events here in Indonesia, this would include Bali, Jakarta and Surabaya.\r\n \r\nWe are happy to see if there are opportunities to provide once-off MICE discounts for your delegates travel to the destination. The airfare discounts would translate to better cost management for your delegates, and we are also able to extend benefits such as the below subject to discussion:\r\n\r\nComplimentary tickets upon min spend (for you as an organiser)\r\nFlexible travel window of 14 days\r\nLoading of discounted fares to your dedicated travel agent\r\nUnique promo code to be used on our website\r\n \r\nDo reach out back to me should you be keen and we can arrange for a call to see h'),
(28, 'Madison', 'm1365048728@163.co\'m', 'apply for exhibition', 'we\'d like to attend the exhibition of INDO BUILD TECH during Nov.16~20 at PTJakartaInternationalExpo .\r\nI wonder how can I attend this exhibtion, it would be appreciate that you could help me. \r\nThanks a lot!\r\nlooking forward to your reply.'),
(29, 'Wahyu liven ', 'rusmanliven@gmail.com', 'Penawaran Bank Garansi ,Surety Bond, Sp2d & Jaminan Pembayaran (Tanpa Agunan)', 'Kepada Yth, \r\nBag, Direksi / Finance     \r\nDi tempat\r\n\r\nPrihal : PENAWARAN BANK GARANSI & ASURANSI (Tanpa Agunan)\r\n\r\nDengan Hormat,\r\nPerkenalkan Kami Dari PT. TEGAR MANDIRI BERSAUDARA (Insurance Brokerage) Dimana Perusahaan Kami Telah Ditunjuk Untuk Memasarkan Penerbitan Bank Garansi & Surety Bond, Tanpa Agunan/Non Collateral, Disini Perusahaan Kami Juga Telah Di Back Up Oleh Beberapa Perusahaan Asuransi Kerugian Swasta Nasional Maupun BUMN. \r\nAdapun Jenis - Jenis Jaminan Dan Asuransi Yang Bisa Kami Terbitkan Sebagai Berikut :\r\n\r\nJENIS JAMINAN :\r\n1. Jaminan Penawaran/Bid Bond\r\n2. Jaminan Pelaksanaan/Peformance Bond        \r\n3. Jaminan Uang Muka/Advance Payment Bond\r\n4. Jaminan Pemeliharaan/Maintenance BondLines Of Insurance\r\n5. SP2D Pembayaran Akhir Tahun\r\n6. Asuransi Pemerintah/Swasta\r\n7. Bank Garansi Pemerintah/Swasta\r\n8.  Asuransi General/CARGO     \r\n\r\nPT. TEGAR MANDIRI BERSAUDARA\r\nWahyu Liven Rusman\r\nMarketing Office\r\nPhone / WA :  0853 8211 8278\r\nEmail:  rusmanliven@gmail.com \r\nNote : Dapat di proses unt'),
(30, 'neti ernawati', 'netiernawati@gmail.com', 'penawaran kain dan souvenir batik', '\r\nSelamat Pagi...\r\n\r\nBapak/Ibu... \r\n\r\nPerkenalkan, Kami dari Hassa Batik Jogja. Pusat seragam batik di Yogyakarta. Alamat kami di Jl Hos Cokroaminoto no 170, Tegalrejo, Kec. Tegalrejo, kota Yogyakarta, Daerah Istimewa Yogyakarta. \r\n\r\nKami melayani pembuatan kain, dan seragam, terutama seragam batik secara massal. Kami ingin menawarkan kerjasama, bila mungkin saat ini atau dimasa mendatang, Bapak/Ibu membutuhkan mitra dalam pengerjaan seragam atau souvenir, dengan senang hati kami siap membantu. \r\n\r\nUntuk lebih detailnya bisa kunjungi kami di https://hassa.co.id/\r\natau ke instagram https://www.instagram.com/hassabatikofficial/ , bisa juga hubungi CS kami di wa.me/6281340004547 atau email ke hassa_batik@yahoo.co.id. Atau dapat juga kami kirimkan portofolio serta proposal bila diperlukan.\r\n\r\nTerimakasih.'),
