(32, 'Kate Trilly', 'katytrilly9@gmail.com', 'Explainer Video for debindo.com', 'Hi,\r\n\r\nWe\'d like to introduce to you our explainer video service, which we feel can benefit your site debindo.com.\r\n\r\nCheck out some of our existing videos here:\r\nhttps://www.youtube.com/watch?v=zvGF7uRfH04\r\nhttps://www.youtube.com/watch?v=cZPsp217Iik\r\nhttps://www.youtube.com/watch?v=JHfnqS2zpU8\r\n\r\nAll of our videos are in a similar animated format as the above examples, and we have voice over artists with US/UK/Australian accents.\r\nWe can also produce voice overs in languages other than English.\r\n\r\nThey can show a solution to a problem or simply promote one of your products or services. They are concise, can be uploaded to video sites such as YouTube, and can be embedded into your website or featured on landing pages.\r\n\r\nOur prices are as follows depending on video length:\r\nUp to 1 minute = $239\r\n1-2 minutes = $339\r\n2-3 minutes = $439\r\n\r\n*All prices above are in USD and include an engaging, captivating video with full script and voice-over.\r\n\r\nIf this is something you would like to discuss further, don\'t hes'),
(33, 'Rachmansyah Darry Putra Panuju', 'sentracouple@gmail.com', '[ Proposal Penawaran Master of Ceremony / Pembawa Acara ] oleh PT Sentra Couple Ekadanta  Yth. Pimpinan PT Debindomulti Adhi', 'Dengan Hormat,\r\nPerkenalkan nama saya Rachmansyah Darry Putra Panuju, selaku CEO dari PT Sentra Couple Ekadanta sekaligus Founder MC Couple Indonesia. Melalui email ini kami sampaikan ketertarikan untuk dapat bekerjasama dan menjadi mitra bisnis PT Debindomulti Adhiwasti.\r\nPerusahaan kami menawarkan sebuah jasa professional MC yang berintegritas serta berprinsip SMART (Sigap, Menarik, Antusias, Ramah dan Tanggap). Hadir sebagai pembawa acara yang berkompeten dalam bidang host, announcer, voice over, public speaker, content creator, dan news anchor. Seluruh talent kami menjadi kebutuhan utama dalam membantu kesuksesan acara yang sedang terselenggara, serta menentukan secara signifikan bagaimana sebuah acara akan berhasil, lancar, berkesan, dan hidup. \r\nBersama dengan email ini kami lampirkan Proposal (Company Profile dan Portofolio) serta Rate Card yang disyaratkan sebagai bahan pertimbangan Bapak / Ibu Pimpinan, kami ucapkan terima kasih. Semoga kami dapat menjadi bagian dari PT Debindomulti Adhiwasti.\r\nPhone'),
