(36, 'Nasi Kotak Kotak', 'nasikotakkotak@gmail.com', 'Proposal Penawaran Nasi Kotak Kotak', 'Dear PT DebIndo,\r\n\r\nPerkenalkan Saya Mina dari Nasi Kotak Kotak\r\nSaya ingin memberikan informasi makanan Nasi Kotak yang berkualitas, praktis, hemat & higienis dimana kualitas mutu & kebersihan dicek oleh tim\r\nQuality Control.\r\n\r\nKami telah beroperasional sejak 2013 dan telah menyediakan kebutuhan Nasi Kotak ke Pertamina, Prudential, Sinarmas, Smartfren, Kementerian Hukum\r\n& Pertahanan, PT JIEP Industri Pulogadung, Bappenas, SCTV Tower, RS Siloam, BPOM, PT Pulau Intan, Distributor Alat Berat\r\nSerta kantor-kantor di Semanggi, Slipi, Sudirman, Thamrin, Sarinah dan masih banyak lainnya\r\n\r\nBerikut Proposal Penawaran kami serta pricelist Nasi Kotak Kotak.\r\nSaat ini kami sedang ada SPECIAL PROMO* (S&K Berlaku), untuk informasi lebih lanjut bisa kontak via WhatsApp di 0819-3222-0470\r\n\r\nApakah ada no kontak PIC yang dapat saya hubungi?\r\nApabila ada teman/kenalan yang membutuhkan produk kami boleh di share informasi ini\r\n\r\nThanks\r\nBest Regards,\r\nWA: 0819-3222-0470\r\nbit.ly/CSNKK1\r\nhttps://instagram.com/NasiKotakKotak\r'),
(37, 'jefry', 'jefry.amp@gmail.com', 'PENAWARAN KERJASAMA PENERBITAN BANK GARANSI DAN SURETY BOND TANPA AGUNAN (NON COLLATERAL)', 'Kepada Yth,\r\nPimpinan /Finance /Hrd\r\nDI -\r\n TEMPAT\r\n\r\nDengan Hormat,\r\n\r\nBersama ini Kami PT.ANDIRA MITRA PERSADA (Consultant of Guarantee Bank Dan Surety Bond) perusahaan\r\nyang unggul dan berpengalaman yang bergerak di bidang Penjaminan Guarantee Bank & Surety\r\nBond tanpa agunan 100% dan General Insurance (Asuransi Umum). Kami memberikan\r\npenawaran berupa penerbitan jaminan pengcoveran Garansi Bank & Asuransi yang di back-up\r\noleh perusahaan perbankan dan asuransi pemerintah maupun swasta yang ternama di Indonesia\r\n(daftar relasi terlampir). Kami telah menerbitkan jaminan lebih dari 970 perusahaan.\r\n\r\nJenis jaminan yang kami terbitkan yaitu sbb:\r\n1.Jaminan Penawaran ( Bid Bond )\r\n2.Jaminan Pelaksanaan ( Peformance Bond )\r\n3.Jaminan Uang Muka ( Advance Payment Bond )\r\n4.Jaminan Pemeliharaan ( Maintenance Bond )\r\n5.Jaminan Akhir Tahun SP2D/Pembayaran ( Payment Bond )\r\n\r\nKelebihan yang kami miliki berupa :\r\n1. Proses cepat\r\n2. Tanpa batasan (unlimited)\r\n3. Biaya kompetitip murah dan tanpa angunan\r\n4. Rate b'),
