(54, 'MUKHTAR', 'mukhta611@gmail.com', 'PENAWARAN JASA IMPORT - EXPORT @ UNDERNAME', 'Yang TerhormatBapak/ Ibu Pimpinan PerusahaanPara Mitra dan Divisi Direktur,Purchasing, Divisi Exim & DomesticDi_TempatUp. (PurchasingImport & Export Dept)\r\nPerihal:Penawaran Jasa Customs Clearance & Undername (Export-Import)\r\nKami dariPT. DEKA PUTRA TRANSINDO (FBE GROUP)sebagai Perusahaan Jasa Kepabeanan yang menanganiCustoms Clearance Import atau Export baik via Bandara maupun via Pelabuhan diseluruh Nusantara, dan menyewakan Undername bagi Consignee yang belum lengkapuntuk persyaratan dan izin Import.\r\n\r\nI. Jasa Customs Clearance:Service dari kami Sbb:-Customs Clearance Export-Customs Clearance Import-Export - Import Udara dan Laut-Handling Export - Import Resmi (Undername)-Trucking ke Gudang Tujuan- PengirimanEx-Works dan FOB dari Negara Asal-Menangani Pengiriman Domestic ke seluruh Nusantara\r\n\r\nII. Jasa Undername Export& Import:-Surat Registrasi Pabean (NIK)\r\n-AngkaPengenal Importir (API-I, API-U, API-P)\r\n-NPIK(Mainan, Elektronic, Garmen, Sepatu dan Peralatan kaki lainnya)\r\n-IT(Besi Baja, Mainan, '),
(55, 'PT MOTOR SIGHTS INTERNATIONAL', 'icha@motorsights.net', 'EXHIBITION INFORMATION 2023', 'Dear Debindo information team.\r\n\r\nPerkenalkan saya Icha selaku Marketing Supervisor PT Motor Sights International.Motor Sights adalah brand dari beberapa seri truk berat di Indonesia seperti dump truck, tractor head, dan lainnya.Kami berencana untuk mengikuti beberapa exhibition di tahun 2023 ini yang berkaitan dengan produk kami.Apabila ada exhibition yang dapat kami ikuti tahun ini, mohon untuk diinfokan melalui email ini atau ke whatsapp saya di 081281363329. \r\n\r\nAtas perhatiannya, kami ucapkan terima kasih.\r\n\r\n\r\n\r\nICHA\r\nMarketing Supervisor PT Motor Sights International\r\n081281363329\r\nicha@motorsights.net'),
(56, 'willy sentosa', 'willysentosa8@gmail.com', 'Carpet Gangway', 'Perkenalkan saya Willy Sentosa, Marketing Executive dari Kreasi Mitra Sarana.\r\nKami  bergerak di bidang Exhibition & Interior Contractor. Kami menawarkan jasa untuk pemasangan Karpet pameran/event & stand/booth pameran sesuai dengan keinginan dan permintaan anda.\r\nApabila ada yg ingin ditanyakan atau didiskusikan, dapat menghubungi saya di nomor ini (+62 81294889 811),\r\nAtas perhatiannya saya ucapkanterimakasih'),
