(68, 'Fitri Feria Wardani (Fifi)', 'fifi.f.wardani@gmail.com', 'Booth Production', 'Dear Bapak/ Ibu Yth,\r\n\r\nPerkenalkan aku dengan Fifi dari SRC Kreasi. SRC Kreasi adalah perusahaan yang telah berpengalaman membuat booth untuk keperluan event ataupun expo.\r\n\r\nKami bermaksud menjajaki kemungkinan kalau Debindo sedang membuat exhibition, kami bisa bekerja sama dalam memproduksi booth untuk peserta2x expo.\r\n\r\nApabila memungkinkan, mohon diberi kesempatan meeting introduction SRC Kreasi kepada Debindo.\r\n\r\nDemikian kami sampaikan. Terima kasih atas waktu dan perhatiannya.\r\n\r\nBest regards,\r\nFitri Feria Wardani (Fifi)\r\nWA 08111592308/ 08161447079'),
