(71, 'Nataly Komova', 'natalykomovawrites@gmail.com', 'Hello', 'Hi\r\n\r\nBy way of an introduction, I am a freelance writer and expert contributor for several magazines and blogs. I am presently aiming to build up my online presence, and would therefore, like to offer you to write some expert articles for your blog on debindo.com (free of charge).\r\n\r\nIf you are interested, please send me up to five topics that you would like me to cover. It will take me around a week or maybe less to write up the articles.\r\n\r\nI look forward to hearing from you. Please ensure that you copy in my personal email in your reply, as sometimes, my work emails tend to go to the spam folder: natalykomova1992@gmail.com\r\n\r\nKind regards\r\n\r\nNataly Komova'),
(72, 'Tanu Roy', 'tanu.roy00710@gmail.com', 'Content Writing Service', 'Hey there, \r\n\r\nI\'m Tanu, a skilled content writer and copywriter who knows how to captivate readers with compelling content. I\'d be thrilled to provide you with a personalized sample specifically designed for your business requirements. Moreover, I can help you with content strategy, keyword research, and website publishing. \r\nConsider me your trusted content expert. \r\n\r\nIf you\'re interested, shoot me an email at tanu.roy00710@gmail.com, and I\'ll send you the pricing information.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n'),
