(93, 'Nadila Nuranijiwa', 'nadilanuranijiwa08@gmail.com', 'Permohonan Dukungan Kegiatan Louder and Louder 2023 BEM Sekolah Vokasi Institut Pertanian Bogor', 'Dalam rangka kegiatan Program Keahlian Komunikasi Sekolah Vokasi, kami akan melaksanakan acara/event lomba nasional yang akan diikuti oleh seluruh mahasiswa/i di Indonesia bertempat di Sekolah Vokasi IPB University pada tanggal 10 Juli s/d 10 September 2023. Louder and Louder 2023 hadir sebagai wadah pengembangan wawasan dan skill mahasiswa di bidang public speaking dengan mengusung tema \"Knowledge is Power, Speaking is Key\". Adapun beberapa perlombaan dalam event ini yaitu: \r\n\r\n1. Debat\r\n2. Stand up comedy\r\n3. Master of Ceremony \r\n\r\nMelihat banyaknya antusias mahasiswa dalam bidang public speaking, maka kami tergerak untuk menyediakan wadah peningkatan kemampuan tersebut yang inovatif dan efektif.\r\n\r\nDemi kelangsungan dan kelancaran acara Seminar Nasional tersebut, kami selaku panitia pengelola acara Louder and Louder bermaksud mengajukan permohonan kepada Bapak/Ibu untuk memberi dukungan kegiatan berupa : dana/produk - produk perusahaan.\r\n\r\nkami sebagai Panitia Penyelenggara Kegiatan memohon kepada Bapak/Ib'),
