(119, 'berry', 'nabil.berry@interflour.com', 'National Sales Conference 2023', 'Dear mr/mrs,\r\n\r\nAccording to our plan for the National Sales Conference (NSC) in Bali, with some detail as below :\r\n\r\n1)	Time estimation: 20-23 September 2023\r\n\r\n2)	Agenda :\r\nDAY 1:   HALF DAY MEETING\r\nDAY 2:   FULLDAY MEETING + KICK-OFF SALES TARGET     \r\nDAY 3:  OUTBOUND / TEAM BUILDING + GALA DINNER\r\nDAY 4: BACK TO HOMETOWN\r\n\r\n3)	Estimation total participant : 120 orang\r\n\r\n4)	Budget Estimation: 1 M \r\n\r\nPlease kindly send the proposal & quotation.\r\n\r\nThank you for your kind attention.\r\n\r\nRegards,\r\nBerry'),
