(121, 'Angela Fransisca Salim', 'angela.f.s.afs@gmail.com', 'Pengajuan magang untuk mahasiswa S1 Event Management Universitas Prasetiya Mulya', 'Dear Ibu/Bapak yang saya hormati,\r\n\r\nSelamat siang Ibu/Bapak, perkenalkan saya Angela Fransisca Salim, mahasiswa Universitas Prasetiya Mulya, Jurusan S1 Event Management. Saat ini, saya sedang menjalani semester 7 dimana setiap mahasiswa berkewajiban untuk menjalani program magang. Program magang ini dilakukan berkelompok dimana pada 1 kelompok terdapat 2 anggota. \r\n\r\nKami melihat bahwa PT Debindo Multi Adhiswasti berkolaborasi dengan Kementrian Perdagangan Republik Indonesia akan mengadakan event The Trade Expo Indonesia pada tanggal 18 hingga 21 Oktober 2023 di ICE BSD. Saya dan teman saya tertarik untuk ikut serta dalam mempersiapkan event The Trade Expo Indonesia, apakah PT Debindo Multi Adhiswasti membuka lowongan magang untuk mahasiswa Events? Dari periode magang, kami mahasiswa Events memiliki tujuan untuk mempelajari ekosistem acara The Trade Expo Indonesia dan juga mempelajari proses sinergisitas dari para stakeholders yang berkaitan. \r\n\r\nBesar harapan saya, Ibu/ Bapak dapat memberikan kabar baik dan'),
(122, 'Tatyana Dyachenko', 'tatyana@manufactured1987.com', 'Collaboration with debindo.com', 'Dear Team at debindo.com,\r\n\r\nI hope this message finds you well. I am reaching out as a freelance writer and part-time journalist with experience writing for various magazines and news outlets.\r\n\r\nI am currently working on expanding my online presence and would like to propose a collaboration with you and debindo.com. I would be delighted to contribute expert articles to your blog on debindo.com at no cost. If you are interested, please provide me with 5 topics, and I will deliver the articles to you within approximately one week.\r\n\r\nThank you for considering this collaboration opportunity, and I look forward to the possibility of working together.\r\n\r\nKind regards,\r\n\r\nTatyana Dyachenko\r\n\r\n'),
(123, 'Natalia Alvarado', 'natalia@shopgiejo.com', 'Collaboration', 'Hey there!\r\n\r\nBy way of introduction, I am a freelance writer and a part-time journalist with a handful of magazines and news outlets.\r\n\r\nI am presently working on expanding my online presence and wanted you to offer the following collaboration:\r\n\r\nI can write up some expert articles for your blog on debindo.com free of charge. If you are interested, please send me 5 topics and I will revert to you with the articles in around a week\'s time.\r\n\r\nI look forward to our collaboration.\r\n\r\nKind regards\r\n\r\nNatalia Alvarado\r\n\r\nSent from my Windows Mail'),
(124, 'Brianna Semmens', 'semmens.brianna85@yahoo.com', 'Meet Robin A.I.: Your All-in-One Virtual Assistant', 'Hi there,\r\n\r\nWe would like to introduce to you Robin AI, the world\'s first app that replaces your entire team with an AI assistant. This powerful tool generates human-like content, creates stunning designs, drives unlimited traffic, and more.\r\n\r\nCheck out the features of Robin AI here: https://shorturl.at/juwGP\r\n\r\nThanks for your time,\r\nBrianna'),
