INSERT INTO `news` (`id`, `judul`, `tgl_post`, `nama_penulis`, `isi`, `image`) VALUES
(5, 'DEBINDO TRY MRT JAKARTA', '2019-03-12', '', 'Uji coba MRT (Mass Rapid Transportation) sudah dapat dinikmati oleh masyarakat DKI Jakarta sejak 12 Maret 2019 lalu. Selama masa uji coba, pengguna MRT dapat menikmati layanan MRT secara gratis. Euforia uji coba MRT ini juga turut dirasakan oleh seluruh karyawan PT Debindomulti Adhiswasti pada tanggal 18 Maret 2019 lalu.Dengan rute Lebak Bulus sampai Bundaran Hotel Indonesia, uji coba MRT terasa sangat menyenangkan. Tidak butuh waktu lama, perjalanan dari stasiun Lebak Bulus ke Stasiun Bundaran Hotel Indonesia hanya memakan waktu kurang lebih 30 menit. Perjalanan yang sangat cepat dibandingkan menggunakan kendaraan pribadi di lalu lintas DKI Jakarta.Selain untuk merasakan bagaimana sensasi menggunakan MRT, kegiatan ini juga diharapkan agar nantinya, karyawan Debindo dapat lebih aktif dalam menggunakan transportasi umum dan turut serta dalam mengurangi kemacetan di DKI Jakarta.', '1_(1).jpg'),
(6, 'DEBINDO ANNIVERSARY', '2019-03-02', '', 'PT Debindomulti Adhiwasti telah memasuki usia ke 32 tahun, tepatnya pada tanggal 2 Maret 2019. Tahun ini, perayaan ulang tahun dilaksanakan di kantor pusat Debindo, yang berada di Gedung G9 Jl. KH. Abdullah Syafei No.9, Jakarta Selatan. Perayaan ini dihadiri oleh seluruh staff dan rekan Debindo.Dalam rangka merayakan Hari Ulang Tahun (HUT) ke-32, perusahaan yang bergerak di industri MICE ini mengadakan doa bersama demi berlanjutnya kesuksesan bisnis yang digelutinya. Selain itu untuk bersyukur kepada Tuhan YME yang selalu menyertai langkah Debindo hingga mencapai usia 32 tahun. Debindo juga berbagi kebahagiaan dengan makan bersama.Acara ini diawali oleh sambutan oleh para Board of Director dari PT Debindomulti Adhiwasti. Debindo berangkat dari bukan apa-apa, dan sekarang kita bersyukur sudah bisa ditahap saat ini, jelas Dwi Karsonno. Hal serupa juga dikatakan oleh Effi Setiabudi 32 tahun lalu, merintis bisnis bidang pameran itu sangat berat. Saya berharap kedepannya Debindo dapat konsisten dalam memberikan', '3.jpg'),
(7, 'DEBINDO SPORTS DAY', '2019-02-22', '', 'Untuk menjaga kebugaran tubuh, olahraga merupakan aktivitas yang sangat penting untuk dilakukan. Terutama bagi pekerja di Jakarta yang sulit untuk mendapatkan waktu untuk berolahraga. Kegiatan olahraga yang rutin dilaksanakan dapat memberi dampak positif untuk produktivitas dalam bekerja.Hal ini membuat PT Debindomulti Adhiswasti rutin melaksanakan kegiatan olahraga setiap hari jumat yang disebut sports week. Selain untuk menjaga kesehatan dan kebugaran tubuh, kegiatan olahraga ini juga penting untuk menambah kekompakan serta menunjang kerja sama yang lebih baik. Adapun manfaat lainnya adalah untuk meningkatkan energi dan membuat mood selalu positif.Futsal dan bulutangkis merupakan kegiatan olahraga tim yang sering dilakukan saat sport week berlangsung. PT. Debindomulti Adhiswasti yakin bahwa olahraga tim dapat memberikan dampak positif dalam menunjang produktivitas kerja, menunjang komunikasi antar pegawai yang lebih baik dan melatih fokus.', '1.jpg'),
(8, 'Mengasah Kemampuan Menulis Karyawan PT. Debindomulti Adhiswasti', '2019-02-06', '', 'Penyampaian pesan, informasi dan komunikasi adalah bagian penting dalam industri bisnis. Baik dalam pekerjaan sehari-hari maupun dalam kegiatan perusahaan saat mempromosikan jasa dan produknya. Sayangya, banyak professional di bidang bisnis belum mengerti bagaimana cara penyampaian pesan dengan baik dan benar.Jakarta, 6 Februari 2019 - Penyampaian pesan, informasi dan komunikasi adalah bagian penting dalam industri bisnis. Baik dalam pekerjaan sehari-hari maupun dalam kegiatan perusahaan saat mempromosikan jasa dan produknya. Sayangya, banyak professional di bidang bisnis belum mengerti bagaimana cara penyampaian pesan dengan baik dan benar.\r\nBertempat di Ruang Pertemuan Gedung Debindo, workshop ini berlangsung dengan serius namun santai. Diawali dengan pemaparan dari Irwan Setiawan, pemimpin redaksi JawaPosTV. Ia memaparkan seluk beluk penulisan jurnalistik. Lalu dilanjutkan dengan Rully Kesuma, fotografer senior majalah Tempo, yang menjelaskan tentang fotografi jurnalistik. Dari acara tersebut, terlihat ant', '11.jpg'),
(10, 'Debindo Network Outing Together Towards Tomorrow', '2018-12-21', '', 'To strengthen the bonds between all of Debindo branches, Debindo held an outing on 19th to 20th December at Panjang Jiwo Resort. This activity was intended to create a positive company culture that truly understands the employees both physical and mental needs.The theme of Debindo outing is Together Towards Tomorrow in which we share the same passion, the same curiosity and same goals as Debindo Network team. We look to continue working with all the branches to maximize opportunities and the collaborative benefits that come from working together as a group. Debindo also focuses on the significance of uniting as a group or community to successfully develop in defiance of global uncertainties.Furthermore, Debindo also conducted a yearly meeting. At the meeting, every branch updated their progress, shared their upcoming projects, exchange ideas and discuss objectives. This meeting is intended to reach a common agreement and create a feeling of continuity and solidarity in a bodys working.\r\n\r\nDebindo hopes th', '1_(1)4.jpg'),
(11, 'Debindo Brainstorming Activity', '2018-12-12', '', 'In the age of new media, where the driving source of social evolution is technology, an established business needs to continue to grow their business by generating new ideas. Ideation is a key commodity in business.  Therefore, on 10th December 2018, Debindomulti Adhiswasti held a brainstorming activity as a key component of successful idea generation in the business.\r\n\r\nThe management has put employees into some groups. The group contains employees from a different department in the company. Debindo believes different skill sets and experiences will give a great mix of new perspectives and contextual knowledge which help the group to create original and doable ideas.\r\n\r\nEmployees are encouraged to let their imaginations grow by using a wishing technique. They were asked to come up with wildest and extreme ideas to create new projects. After that, focusing on a selection of project wishes, consider and discuss the ideas in detail, with the aim of triggering new but more realistic concepts to pursue. They were', '41.jpg'),
(12, 'Pameran Indocraft ke-15 Resmi Dibuka', '2018-11-21', '', 'Acara tahunan batik dan craft, Pameran Indocraft, kembali dilaksanakan untuk ke-15 kalinya. Pameran ini merupakan pameran rutin yang diselenggarakan oleh PT. Debindomulti Adhiswasti. Indocraft 2018 resmi dibuka oleh Deputi Bidang Pengembangan Kementerian Pemuda dan Olahraga. Bapak Dr. H.M.Asrorun Ni\'am Sholeh, MA. Indocraft ke-15 berlangsung mulai tanggal 21-25 November 2018 di Cendrawasih Hall, Jakarta Convention Center, Senayan. Pameran ini kembali hadir dengan produk batik, kain dan craft yang lebih bervariatif. Pengunjung dapat memburu pakaian hingga aksesori fesyen pada acara tahun ini.\"Pameran tahun ini diikuti oleh lebih dari 160 peserta yang terdiri dari 1 Kementerian Pemuda dan Olahraga yang menampilkan 5 UKM Mitra Binaan, 5 Badan Usaha Milik Negara yang menampilkan 18 UKM Mitra Binaan. 4 Pemerintah Daerah yang menampilkan 9 UKM Binaan, dan 128 UKM Swasta Mandiri,\" jelas Rizal Adiputra, Ketua Pelaksana Pameran Indocraft 2018, pada saat acara pembukaan Indocraft 2018 Selama pameran berlangsung. penyel', '1_(1)6.jpg'),
(13, 'First Day of TEI 2018 Recorded 44 Trade Contracts & Investment', '2018-11-24', '', 'On the first day, TEI 2018 was successfully recorded the signing of 44 trade contracts and investment, consisting of trade transactions of USD 513.97 million and investments of USD 4.68. That became a new record. For the investment sector, carried out by investors from Thailand of USD 180 million in the form of real estate development and USD 4.5 billion in the form of Information Technology (IT) facilities. The value of this investment has just been included in total TEI transactions in the last two years, so it is not just a trade value. The signing of the purchase mission was witnessed by Minister Enggartiasto Lukita and Foreign Minister Retno Marsudi.\r\n\r\nThe trade contracts are from South Korea, Australia, Saudi Arabia, Belgium, France / Austria, China, the Netherlands, Spain, Mexico, Thailand, Chile, Singapore, Malaysia, United States, Philippines, Brazil, United Kingdom, Germany, Egypt, Nigeria, Italy, Hong Kong, Taipei, UAE, Iraq and Japan. Ministry of Trade is targeting the value of transactions durin', '13.jpg'),
(14, 'SOUTHEAST ASIAS LEADING SUPPLY CHAIN EXHIBITION AND CONFERENCE', '2018-05-06', '', 'CTCT was held on the 2nd to 6th May 2018 at the Indonesia Convention Exhibition, BSD Tangerang. This exhibition consists of CeMAT Southeast Asia | IndoTransLog | IndoColdChain | IndoTruck 2018 (CTCT) which is the new name and continued from the rst edition CeMAT Southeast Asia | TransAsia Jakarta | ColdChain Indonesia (CTC), organized jointly by PT. Debindomulti Adhiswasti and Deutsche Messe, showing three pillars of supply-chain industry: intralogistics, external logistics transportation and cold-chain.\r\n\r\nDesigned to be a business platform for supply chain business stakeholders, CTCT 2018 represents a synergy between the exhibition organizers and the industry associations of Indonesian Logistic and Forwarders Association (ALFI), Indonesian Logistics Association (ALI), Indonesian Cold Chain Association (ARPI) and Indonesian Trucks Association (APTRINDO) in support to government policy in increasing logistics services quality and Indonesian multimodal transportation, as well as the Indonesian Chamber of Comm', 'CTCT11.jpg'),
(15, 'PENGUMUMAN RESMI PEMENANG GRAND PRIZE MANDIRI PROPERTY EXPO 2018', '2018-05-13', '', 'PT Debindomulti Adhiswasti selaku penyelenggara Mandiri Property Expo 2018 di Jakarta Convention Center 5-13 Mei 2018, dengan bangga menyampaikan kabar gembira bahwa Grand Prize berupa 1 Unit Rumah telah dimenangkan oleh:\r\nSdri. \r\n\r\nVEGA THERESIA Dengan Nomer Kupon 00048\r\n\r\nPengundian telah dilaksanakan sesuai jadwal yaitu Minggu 13 Mei 2018 Jam 20:00 WIB di area stand Bank Mandiri, disaksikan langsung oleh pejabat berwenang dan notaris serta para pengunjung pameran \r\n\r\nPT Debindomulti Adhiswasti bersama DPD REI Jakarta dan Bank Mandiri mengucapkan Selamat dan Sukses kepada Sdri. Vega Theresia sebagai pemenang Grand Prize 1 Unit Rumah Mandiri Property Expo 2018. Surat resmi pemberitahuan nama pemenang dan informasi penyerahan hadiah akan dikirimkan kepada Sdri. Vega Theresia sesuai data isian kupon undian Pemenang dapat langsung menghubungi pihak penyelenggara di: \r\n\r\nPT. DEBINDOMULTI ADHISWASTI GEDUNG G9 Lt. 3 JL. KH. ABDULLAH SYAFEI NO.9. TEBET, JAKARTA 12840 NO. TELP. 021-8298004, 8309716, 8310656', 'UNDIAN1.jpg'),
(16, 'KUNJUNGI MANDIRI PROPERTY EXPO 2018 DAN REBUT GRAND PRIZE 1 UNIT RUMAH', '2018-05-05', '', 'PT Bank Mandiri Tbk. (Persero) menghadirkan solusi pemilikan properti hunian dan niaga melalui penyelanggaraan Mandiri Property Expo 2018 di Jakarta Convention Center tanggal 5-13 Mei 2018. bekerjasama dengan PT Debindomulti Adhiswasti dan didukung oleh DPD REI Jakarta. Solusi pemilikan properti secara mudah dan cepat bisa dinikmati melalui aplikasi \"Mandiri KPR\" dengan suku bunga hanya 5.55% /tahun efektif fixed untuk 2 tahun pertama dan 6.55%/ tahun efektif fixed untuk 3 tahun berikutnya.\r\n\r\nAneka ragam jenis properti di berbagai lokasi strategis persembahan para pengembang terkemuka peserta Mandiri Property Expo 2018 menjadi pilihan investasi keluarga dan bisnis terbaik saat ini. Selain menjadi investasi yang menguntungkan seleras perkembangan harga tanah, pembelian properti melalui \"Mandiri KPR\" di Mandiri Property Expo memberikan kesempatan merebut berbagai hadiah menarik, dengan hadiah utama 1 unit rumah di lokasi strategis. Siapkan kunjungan Anda ke Mandiri Property Expo dan wujudkan properti impian de', 'MANDIRIPROPERYEXPO11.jpg'),
(17, 'PRESIDEN BUKA PAMERAN TRADE EXPO INDONESIA 2017', '2017-11-11', '', 'Presiden Joko Widodo (Jokowi) membuka pameran dagang terbesar di Indonesia, Trade Expo Indonesia (TEI) ke-32 di Indonesia Convention Exhibition Bumi Serpong Damai (ICE BSD), Tangerang Selatan, Banten. Pameran ini berlangsung pada 11-15 Oktober 2017.\r\n\r\nGrand Opening diselenggarakan oleh Menteri Perdagangan Bapak Enggartiasto Lukita dan Direktur Jenderal Pengembangan Ekspor Nasional Ibu Arlinda, dihadiri oleh Menteri Koordinator Perekonomian Indonesia, Bapak Darmin Nasution, dan lebih dari 4.000 undangan yang terdiri dari pembeli, peserta pameran, duta besar Indonesia dan asing dan pengunjung dari negara asal dan luar negeri.\r\n\r\nSelain itu, dalam Opening Ceremony juga menyoroti penghargaan Primaniyarta untuk 22 eksportir Indonesia terbaik dan penghargaan Primaduta untuk 33 pembeli luar negeri berkinerja terbaik dan satu penghargaan untuk kategori pembeli inspiratif dari Australia.\r\n\r\nLima di antara 33 penerima penghargaan Primaduta adalah importir dari Republik Korea: H Heesung Catalyst Corporation, ITC Co., L', 'TEI11.jpg'),
(18, 'BERBURU RUMAH MURAH DI REI EXPO 2017', '2017-04-15', '', 'Real Estate Indonesia Expo (REI Expo) 2017 berlangsung sejak hari Sabtu (15/4/2017) hingga Minggu (23/4/2017). Pameran ini digelar di JCC Senayan mulai pukul 10.00 WIB hingga pukul 21.00 WIB. Sejumlah pengembang properti tengah berkumpul untuk memeriahkan acara REI EXPO 2017. Di sana para pengembang saling berlomba-lomba menawarkan produknya melalui gelaran properti REI Expo\r\n\r\nMengingat harga rumah rumah saat ini sedang tinggi-tingginya dan sulit dijangkau generasi milenial. berbagai pengembang ternama banyak menawarkan berbagai promo unggulan mereka, mulai dari apartemen tanpa DP seharga Rp 350 jutaan, hingga rumah tapak dengan harga ratusan juta hingga miliaran\r\n\r\nSejumlah pengunjung pun ramai memadati pameran Tak hanya pengunjung para marketing pemasaran masing-masing pengembang juga telah sigap menarik pengunjung untuk menawarkan produk propertinya\r\nProperti yang ditawarkan para pengembang itu tidak hanya berlokasi di Jakarta saja, tapi juga di berbagai daerah. Misalnya kawasan Bogor, Depok, Tangerang, h', 'REI1.jpg');
